import {
  HiOutlineViewGrid,
  HiOutlineCube,
  HiOutlineShoppingCart,
  HiOutlineUsers,
  HiOutlineDocumentText,
  HiOutlineAnnotation,
  HiOutlineQuestionMarkCircle,
  HiOutlineCog,
} from "react-icons/hi";

export const DASHBOARD_SIDEBAR_LINKS = [
  {
    key: "dashboard",
    label: "Dashboard",
    path: "/",
    icon: <HiOutlineViewGrid />,
  },
  {
    key: "leave",
    label: "Leave",
    path: "/leave",
    icon: <HiOutlineCube />,
  },
  {
    key: "attendance",
    label: "Attendance",
    path: "./attendance",
    icon: <HiOutlineShoppingCart />,
  },
  {
    key: "myinfo",
    label: "My Info",
    path: "/myinfo",
    icon: <HiOutlineDocumentText />,
  },
  {
    key: "task",
    label: "Task",
    path: "/task",
    icon: <HiOutlineAnnotation />,
  },
  {
    key: "customers",
    label: "Customers",
    path: "/customers",
    icon: <HiOutlineUsers />,
  },
  {
    key: "admin",
    label: "Admin",
    path: "/admin",
    icon: <HiOutlineCog />,
  },
  {
    key: "claim",
    label: "Claim",
    path: "/claim",
    icon: <HiOutlineQuestionMarkCircle />,
  },
];

export const DASHBOARD_SIDEBAR_BOTTOM_LINKS = [
  {
    key: "admin",
    label: "Admin",
    path: "/admin",
    icon: <HiOutlineCog />,
  },
  {
    key: "claim",
    label: "Claim",
    path: "/claim",
    icon: <HiOutlineQuestionMarkCircle />,
  },
];
